import BaseService from './baseService.js'
import cloneDeep from 'lodash/cloneDeep'

class PaymentTransactionService extends BaseService{
    getPaymentTransaction(opts = {}){
        this.endPoint = '/get-payment-transactions'
        return this.get(opts)
    }

    storePaymentTransaction(payload, opts){

        this.endPoint = '/payment-transactions'
        const newOpts = cloneDeep(opts, {
            headers: {
                'Content-Type': 'multipart/form-data'
            }
        })
        return this.post(payload, newOpts) 
    }

}

export default new PaymentTransactionService()
